    [Inject]
    private RepoFactory repoFactory { get; set; }

    private List<Meal> plannedMealList = new List<Meal>();
    private int userID;
    private int mealID;
    protected int MealID { get { return mealID; } set { mealID = value; SelectedMealService.MealID = value; } }
